import Link from 'next/link';

const NavProps = {
    title,
    links,
    logo
}

function Navigation(NavProps) {
    return (
        <div id='nav'>
            <h1>{NavProps.title}</h1>
            <ul>
                {NavProps.links.map((link, i) => {
                    return <Link key={i} href={link.url}><li>{link.name}</li></Link>
                })}
            </ul>
        </div>
    )
}

function Layout({children, links}) {

    return (
        <div id='layout'>
            <Navigation NavProps={title='BurkeDeveloping', links={links}, logo='/uplinkflat.png'}/>
            <div id="canvas">
                {children}
            </div>
            <style jsx global>{`
                #layout {
                    float: left;
                    width: 100%;
                }
                #canvas {
                    float: left;
                    width: 100%;
                }
                #__next {
                    float: left;
                    width: 100%;
                    height: 100%;
                    padding: 0;
                    margin: 0;
                }
                body {
                    float: left;
                    width: 100%;
                    height: 100%;
                    padding: 0;
                    margin: 0;
                }
                html {
                    float: left;
                    width: 100%;
                    height: 100%;
                    padding: 0;
                    margin: 0;
                }
            `}</style>
        </div>
    )
}

// Layout is out containing shell
// -> Canvas is inner container shell

export default Layout
